import logo from "../../assets/images/google-logo.png"
import classes from "./Login.module.css"

const Login = () =>{
    return (
        <div className={classes.bigDiv}>
            <button>
            <img src={logo} width="50px"/>
            Log In with Google
            </button>

        </div>
    )

}
export default Login
